import { NavLink } from 'react-router-dom'

function Nav() {
	return (
		<nav>
			<ul>
				<li>
					<NavLink className={({ isActive }) => (isActive ? 'tamoActivo' : '')} to="/">Inicio</NavLink>
				</li>
				<li>
					<NavLink className={({ isActive }) => (isActive ? 'tamoActivo' : '')} to="/productos">Productos</NavLink>
				</li>
			</ul>
		</nav>
	)
}
export default Nav;
